    return (
        <section className='home text-light' id='home'>
            <Container className='align-items-center px-'>
             
                <span className='tag-line'><h1 style={{fontSize:50}}>Welcome to my Portfolio</h1></span>
                <h1>{`Hi I'm webcoded`}<span className='wrap'>web developer</span></h1>
                <p>find a paragraph to write here</p>
                <Button variant='link' onClick={()=> console.log('connect')}>Let's connect<ArrowDown size={25}/></Button>
            
            </Container>
        </section>
    )
}
